"""
### **Cálculo da diversidade vocabular de um texto**
"""

def calculate_vocab_diversity(text):
    tokens = text.split()
    unique_tokens = set(tokens)
    num_tokens = len(tokens)
    num_unique_tokens = len(unique_tokens)

    if num_tokens > 0:
        diversity = num_unique_tokens / num_tokens
    else:
        diversity = 0

    return diversity

